import React, {Component} from 'react'
import {mobile} from './object/mobile.js';
import './App.css'

const name = 'samsung'
class App extends Component {
  render () {
    return (
      <div>
        <h2>List of mobiles:</h2>
        <div class="list">{mobile(name)}</div>
      </div>
    );
  }
}

export default App;
